import { useEffect } from 'react';
import '../App.css';
import Header from "./Header"
import PageContainer from "./PageContainer"

const infoUrl = 'https://theaudiodb.com/api/v1/json/2/artist.php?i=112028'

function App() {

  useEffect(fetchInfo, [])
  function fetchInfo(){
    fetch(infoUrl)
    .then(r=>r.json())
    .then(console.log)
  }

  return (
    <div className="App">
      <header className="App-header">

        <Header />
        <p>this is our tyler page</p>
        <PageContainer />
      </header>
    </div>
  );
}

export default App;
